import React from "react";
import { Outlet } from "react-router-dom";
import { Header, Footer } from "../../components";
import "./Home.scss";

const Home = () => {
  return (

    <div className="main-app-wrapper">
      <Header />
      <div className="content-wrapper">
        <p>Home page</p>
        <Outlet />
      </div>
      <Footer />
    </div>

  );
};

export default Home;
